import React from 'react';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { loginUser, setCurrentUser, logoutUser } from "../../../actions/authAutentications";

//componenti da react-bootstrap
import { Navbar, ButtonGroup, DropdownButton, Dropdown} from 'react-bootstrap';

//icone da material ui-icons
import PersonIcon from '@material-ui/icons/Person';
import { blue } from '@material-ui/core/colors';

//Componenti nostre
import Logo from '../../../immagini/logo.png'

let stile;


class MyNavbar extends React.Component{ 
    onLogoutClick = e => {
        e.preventDefault();
        this.props.logoutUser();
      };
    constructor(props){ 
       super(props); 
    }
    render(){ 
        try{
            const { user } = this.props.auth;
            if(user.ruolo==='Cliente')
            stile = 'Cliente'
        } catch (error){
            stile = 'Default'
        }
    switch(stile) {
            case 'Cliente':
                return( 
                <div>
                    <Navbar expand="lg" className="Navbar justify-content-between">
                        <Navbar.Brand href="/HomeCliente">
                        <img
                        src={Logo}
                        width="50"
                        height="50"
                        alt="Karm-Logo"
                        className="logonavbar"
                        />
                        </Navbar.Brand>
                        <Navbar.Toggle />
                        <DropdownButton
  menuAlign="right"
  title="Profilo"
  id="dropdown-menu-align-right"
  style={{backgroundColor:'#010101'}}
>
  <Dropdown.Item eventKey="1">Mio Profilo</Dropdown.Item>
  <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
  <Dropdown.Item eventKey="3">Something else here</Dropdown.Item>
  <Dropdown.Divider />
  <Dropdown.Item eventKey="4" style={{backgroundColor: 'red'}} onClick={this.onLogoutClick}>Disconnettiti</Dropdown.Item>
</DropdownButton>
                    </Navbar>
                </div>
              );  
            default:
              return( 
                <div>
                    <Navbar expand="lg" className="Navbar" style={{display:'block', textAlign: 'center'}}>
                        <Navbar.Brand href="/Login">
                        <img
                        src={Logo}
                        width="50"
                        height="auto"
                        alt="Karm-Logo"
                        className="logonavbar1"
                        />
                        </Navbar.Brand>
                    </Navbar>
                </div>
              );   
          }
    }
 }

 MyNavbar.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired,
  };
  
  const mapStateToProps = state => ({
    auth: state.auth,
  });
  
  export default connect(
    mapStateToProps,
    { logoutUser }
  )(MyNavbar);
